import React from 'react'
import styled from 'styled-components'

const Header = () => {
  return (
	<div>Header</div>
  )
}

const HeaderContainer = styled.header`
	height: 100%;
	width: 100%;
	display: flex;
	justify-content: space-between;
	background: #fff;
`;

export default Header
